'use strict';
class InternalOffersLoader {
    manager;
    static create(manager) {
        let result;
        result = new InternalOffersLoader();
        result.manager = manager;
        return result;
    }
    ensureOffersLoaded(offerIds, callback) {
        this.manager.ensureOffersLoaded(offerIds, callback);
    }
}
module.exports = InternalOffersLoader
